import React from "react";


const Preview = (props) => {
    const{personalInfo} = props
    const listItems = personalInfo.map((personalInfo) =>
        <div key={personalInfo.id}>{personalInfo.name}{personalInfo.email}{personalInfo.phone}</div>
    );


    return (
        <ul>{listItems}</ul>
    )
}


export default Preview;
